import React from "react";
import { useParams } from "react-router-dom";

const OrganSelect = ({organ}) => {
    const { id } = useParams()

    const organSelect = organ.map((organ) => {
        return (
            <div key={organ._id}>
                <h2>{organ.name}</h2>
                <img src={organ.diagram} alt="Organ-diagram" />
            </div>


        )
    })
    return ( 
        <div>
            {organSelect}
        </div>
     );
}

export default OrganSelect;
